import './SimpleForm.css';
import React, { useState } from 'react';
import axios from 'axios';

const SubmissionContent = ({ name, division, subdivision }) => {
  const [formData, setFormData] = useState({
    field1: '',
    field2: '',
    field3: '',
    field4: '',
    field5: '',
    field6: '',
    field7: '',
    field8: '',
    field9: '',
    field10: '',
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  axios.post('http://localhost:3000/api/submission', formData)
  .then((response) => {
    console.log(response.data); // Data saved successfully message from the backend
    // Optionally, you can handle success here or notify the user
  })
  .catch((error) => {
    console.error('Error:', error); // Log the error if something went wrong
    // Optionally, you can handle the error or notify the user
  });


  return (
    <div className="submission-content-container">
      <div className="submission-content">
      <h3>Fill the additional details for monthly report</h3>
        <p>Circle: {name}</p>
        <p>Division: {division}</p>
        <p>Sub-Division: {subdivision}</p>
        {/* New form for additional inputs */}
        <form onSubmit={handleSubmit}>
          {/* 10 input fields */}
          <div>
        <label htmlFor="field8">Month:</label>
        <select
          type="text"
          id="field8"
          name="field8"
          value={formData.field8}
          onChange={handleInputChange}
        >
          <option value="">Select Month</option>
            <option value="January">January</option>
            <option value="Febuary">Febuary</option>
            <option value="March">March</option>
            <option value="April">April</option>
            <option value="May">May</option>
            <option value="June">June</option>
            <option value="July">July</option>
            <option value="August">August</option>
            <option value="September">September</option>
            <option value="October">October</option>
            <option value="November">November</option>
            <option value="December">December</option>
          </select>
      </div>
          <div>
          <label htmlFor="field9">Year:</label>
            <input
              type="number"
              id="field9"
              name="field9"
              value={formData.field9}
              onChange={handleInputChange}
              placeholder="Enter Year"
            />
            <label htmlFor="field1">Injection:</label>
            <input
              type="number"
              id="field1"
              name="field1"
              value={formData.field1}
              onChange={handleInputChange}
              placeholder="Enter Injection value"
            />
            <label htmlFor="field2">Unit Billed:</label>
            <input
              type="number"
              id="field2"
              name="field2"
              value={formData.field2}
              onChange={handleInputChange}
              placeholder="Enter Unit Billed value"
            />
          </div>
          {/* ... */}
          <div>
            <label htmlFor="field3">Total IRCA Collection:</label>
            <input
              type="number"
              id="field3"
              name="field3"
              value={formData.field3}
              onChange={handleInputChange}
              placeholder="Enter Total IRCA Collection value"
            />
          </div>

          <div>
            <label htmlFor="field4">Current Demand IRCA:</label>
            <input
              type="number"
              id="field4"
              name="field4"
              value={formData.field4}
              onChange={handleInputChange}
              placeholder="Enter Current Demand IRCA value"
            />
          </div>

          <div>
            <label htmlFor="field5">No of Consumers:</label>
            <input
              type="number"
              id="field5"
              name="field5"
              value={formData.field5}
              onChange={handleInputChange}
              placeholder="Enter No of Consumers in a sub-division"
            />
          </div>

          <div>
            <label htmlFor="field6">No of Bill Served:</label>
            <input
              type="number"
              id="field6"
              name="field6"
              value={formData.field6}
              onChange={handleInputChange}
              placeholder="Enter No of Bill Served in a sub-division"
            />
          </div>

          <div>
            <label htmlFor="field7">Total Area:</label>
            <input
              type="number"
              id="field7"
              name="field7"
              value={formData.field7}
              onChange={handleInputChange}
              placeholder="Enter Total Area"
            />
          </div>


            <button type="button" onClick={handleSubmit}>
                                Submit
                            </button>

        </form>
      </div>
    </div>
  );
};

export default SubmissionContent;
